import Cards from "../components/Cards";
import axios from 'axios'
import "../css_styles/TechList.css";

const TechList = () => {
  const [techs, setTechs] = useState([])
  useEffect(() => {
    async function fetchTech() {
      const { data } = await axios.get('http://127.0.0.1:8000/api/technology/list/')
      setTechs(data)


    }
    fetchTech()
  }, [])
  console.log("tech", techs)

  return (
    <>
      <div className="techlist">
        <div className="techlist__tech">
          <div className="techlist__header">
            <h2>This is the Latest Tech news --{tech.length}</h2>
          </div>
          {techs.map(tech => (
            <col key={tech.id}>

            </col>
          ))}
          <Cards tech={techs}/>
          <Cards />
          <Cards />
          <Cards />
        </div>
        <div className="techlist__ads">
          <h2>Hi</h2>
        </div>
      </div>
    </>
  );
};

export default TechList;
